in vec2 v_uv0;
uniform sampler2D texture;
#endif
uniform conVf {
  vec4 colorAmbient;
  vec2 oPoint;
  vec2 radius;
  float saturation;
};
float calIntentsity(vec2 posCur, vec2 posAim, vec2 rangeArea){
  float result = 1.;
  result = smoothstep(rangeArea.x,rangeArea.y,
    sqrt(pow(posCur.x - posAim.x,2.) + pow(posCur.y - posAim.y,2.)));
  return result;
}
vec4 spotlightOn(){
    vec4 color = vec4(1, 1, 1, 1);
    color *= colorAmbient * v_color;
    color.a *= calIntentsity(v_uv0,oPoint,radius);
    return color;
}
