    o.rgb *= (texture_tmp.rgb * texture_tmp.rgb);
    o.a *= texture_tmp.a;
  #else
    o *= texture_tmp;
  #endif
  #endif
  o *= spotlightOn();
  o *= v_color;
  #if USE_BGRA
    gl_FragColor = o.bgra;
  #else
